import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
// import { useParams } from 'react-router';
import axiosWithAuth from '../Util/axiosWithAuth';


const SellersDashboard = () => {
    const [ items, setItems ] = useState([])

  // const { id } = useParams()

 useEffect(() => {
   axiosWithAuth()
    .get(`/products`)
    .then(res => {
      console.log({res})
      setItems(res.data)
    })
    .catch(err => {
      console.log({err})
    })
  }, [])
  
  return (
    <div>
        <h1>Sellers Dashboard</h1>
          {/* {items.map((item) => {
            return <p>{item.email}</p>
          })} */}
        <Link to="/movies/add" className="btn btn-success"><i className="material-icons">&#xE147;</i> <span>Add New Movie</span></Link>
            <Link to="/movies" className="btn btn-primary">View All Movies</Link>
    </div>
  )
}

export default SellersDashboard;
